INSERT INTO dntp_msgstr VALUES (1479,541,0,'あなたを招待した人は、あなたが拒否したことを知らされます。<br />そして、他の人があなたを招待したら、再び招待メールを受け取ることになります。<br />招待を拒否をするためには、拒否した理由を記入して（省略可能）、「拒否」ボタンを押してください。','y','ja_JP','katsutoshi','ok','y',NULL,1095160213);
